import logo from './fishermary-.svg';
import Nav from './Nav';
import './App.css';

function App() {
  return (
    <div className="container">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
      <Nav />
    </div>
  );
}

export default App;
